INSERT INTO `cms` (`id`, `title`, `slug`, `content`, `status`, `created`, `modified`) VALUES
(1, 'About Us', 'about-us', '<p>Medicine and more is mobile application and ecommerce portal offered by M/s. Medicine and more, &#39;VastuPratik&#39; Appartment, opposite bank of India, pratapnagar, Nagpur, Maharashtra,India 440022 which takes cares of all your daily drug stores need, which making people’s life’s easier with convenient online order placing by instantly upload your prescription and leave the rest to our pharmacist – they will reach out to you promptly.</p>\r\n\r\n<p> we offer complete range of prescription and non-prescription items which includes Allopathic, Ayurvedic medicines, Surgical items, cosmetic,  OTC’s, Supplements, Instruments, Body care and Baby care products. </p>', 'Active', '2019-11-04 14:14:57', '2019-11-04 14:14:57'),
(2, 'Medicine Delivery Policy', 'medicine-delivery-policy', '<p>Important Instructions:</p>\r\n\r\n<p>1. Valid prescription from a Doctor is mandatory for all medicine orders<br>\r\n2. Kindly display the original prescription at the time of picking up medicines<br>\r\n3. We will not be able to process the orders without a valid prescription<br>\r\n4. Please show prescription at the time of delivery<br>\r\n5. HOME DELIVERYS NOT AVAILABLE FOR SCHADULED DRUGS.<br>\r\n6. Delivery charges depend on mode of transit and will be communicated before dispatch.<br>\r\n7. Delivery charges within Nagpur city is Rs.6 per kilometer.</p>\r\n\r\n<p><br>\r\n<strong>Note:</strong><br>\r\n 1. You are required to send a scan copy or photo of valid prescription from an authorized Doctor which is mandatory<br>\r\n2. No medicine will be delivered if the order amount is below Rs.1000 and avail free home delivery<br>\r\n3. Payment method only COD (Cash on Delivery) or card payment on doorstep is available<br>\r\n4. For all in stock items the delivery time will be confirmed by telephonic communication or notification through app or by SMS subject to availability.</p>\r\n\r\n<p><br>\r\n<strong> Upload Prescription:*</strong><br>\r\nAllowed file types: doc, docx, jpeg & pdf.<br>\r\nMandatory contents required in prescription<br>\r\n- Doctor&#39;s Registration Number<br>\r\n- Doctor&#39;s Name and Address<br>\r\n- Patients Name and Age<br>\r\n- Prescription Date (According to Prescription and doses)<br>\r\n- Rx Symbol<br>\r\n- Medicine Name</p>\r\n\r\n<p><strong>Please enter the list of drugs to avoid misreading, However it is not mandatory.</strong></p>\r\n\r\n<p>Once the order is placed by either method, Prasad medical & general stores shall examine the authenticity of the order in terms of Products ordered & will deliver the order after complying with the requirements of Drugs and Cosmetic Act. Please note that for some medicines which are sensitive to pharmacy rules, we will ask a genuine prescription to be verified before sale.</p>\r\n\r\n<p><br>\r\n<strong>E-mail And SMS</strong></p>\r\n\r\n<p>By registering Your phone number and email with us, You consent to be contacted by Us via<br>\r\nphone calls and/or SMS notifications or emails, in case of any order or shipment or delivery related<br>\r\nupdates and/or to update you about new offers and promotions..</p>\r\n\r\n<p><br>\r\n<strong>Refunds Possible If</strong></p>\r\n\r\n<ul>\r\n <li> you received a defective item;</li>\r\n <li> the ordered item(s) is lost or damaged during transit;</li>\r\n <li> the ordered item(s) is past its expiry date.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Changes to these Terms and Conditions</strong></p>\r\n\r\n<p>we reserve the right to amend these terms and conditions from time to time without further notice to<br>\r\nyou. Any such amendments we make shall be effective once we post a revised version of these<br>\r\nTerms and Conditions</p>', 'Active', '2019-05-28 11:44:00', '2019-05-28 11:44:00'),
(3, 'Privacy Policy', 'privacy-policy', '<p><strong>Prasad medical and general stores, pratapnagar, nagpur</strong> the owner and operator of Prasadmedical.com and Prasad medical pratapnagar app (both henceforth referred to as \"Prasad medical app\", \"we\", \"us\", \"our\") and its subsidiaries and affiliates, provide their services and information contained on this website or any of the pages comprising the website (\"website\") to visitors (\"visitors\") (cumulatively referred to as \"you\" or \"your\" hereinafter) subject to this privacy policy, terms and conditions and any other relevant terms and conditions, policies and notices which may be applicable to a specific section or module of this website.</p>\r\n\r\n<p> \r\n<p>Prasadmedical app and its affiliates respect your privacy and value the trust you place in us, hence we insist upon the highest standards for secure transactions and customer information privacy. This Privacy Policy (\"Policy\") describes in brief the manner in which your data is collected, used and shared by the Platform. You are advised to please read the Policy carefully to learn about our information gathering and dissemination practices. By streaming or accessing the Platform, You agree to the collection and use of Your data by Us in the manner provided in this Policy.</p>\r\n</p>\r\n\r\n<p>Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>\r\n\r\n<p>By visiting this Website or using our services, you agree to be bound by the terms and conditions of this Privacy Policy. If you do not agree please do not use or access our Website.</p>\r\n\r\n<p>By mere use of the Website, you expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy. This Privacy Policy is incorporated into and subject to the Terms of Use.</p>\r\n\r\n<p>This Policy applies only to our Services and we are not responsible for the content or privacy practices on any other website to which our Website links or that links to our Services. We encourage you to review the privacy policies of those other websites or services so that you can understand how they collect, use and share your information.</p>\r\n\r\n<p><strong>1. Collection of Personally Identifiable Information and other Information</strong></p>\r\n\r\n<p>While you can browse some sections of our Website without being a registered member, certain activities (such as placing an order) do require registration. We do use your contact information to send you offers based on your previous orders and your interests. When you use our Website, we collect and store your personal information which is provided by you from time to time such as your name, age, gender, email address, residential address, telephone/mobile number, blood group, medical case and other relevant information as may be required.</p>\r\n\r\n<p>In addition to the above, while you access or interact with the Services from any technological device which includes but is not limited to mobiles, tabs and computer system we may receive certain information, viz.:</p>\r\n\r\n<p>1. the name of your internet service provider;</p>\r\n\r\n<p>2. the IP address of the computer you use to access our Services;</p>\r\n\r\n<p>3. the operating system you are using;</p>\r\n\r\n<p>4. the date and time you access our Services;</p>\r\n\r\n<p>5. the website address, if any, that linked you to our Services;</p>\r\n\r\n<p>6. search engine, search terms and advertising clicks/actions;</p>\r\n\r\n<p>7. surveys&#39; responses to the extent you do not include Personal Information;</p>\r\n\r\n<p>8. the manufacturer and model of your mobile device;</p>\r\n\r\n<p>9. your mobile operating system;</p>\r\n\r\n<p>10. the type of mobile internet browsers you are using;</p>\r\n\r\n<p>11. your geo-location;</p>\r\n\r\n<p>12. information about how you interact with our Website, such as how many times you use a specific part of the Website over a given time period, the amount of time you spend using the Website, how often you use the Website, actions you take in the Website and how you engage with the Website;</p>\r\n\r\n<p>13. information to allow us to personalize the services and content available through the Website</p>\r\n\r\n<p>Our primary goal in doing so is to provide you a safe, efficient, smooth and customized experience. This allows us to provide services and features that most likely meet your needs, and to customize our Website to make your experience safer and easier. More importantly, while doing so we collect personal information from you that we consider necessary for achieving this purpose.</p>\r\n\r\n<p>In general, you can browse the Website without telling us who you are or revealing any personal information about yourself. Once you give us your personal information, you are not anonymous to us. Where possible, we indicate which fields are required and which fields are optional. You always have the option to not provide information by choosing not to use a particular service or feature on the Website. We may automatically track certain information about you based upon your behaviour on our Website. We use this information to do internal research on our users demographics, interests, and behaviour to better understand, protect and serve our users. This information is compiled and analysed on an aggregated basis. This information may include the URL that you just came from (whether this URL is on our Website or not), which URL you next go to (whether this URL is on our Website or not), your computer browser information, and your IP address.</p>\r\n\r\n<p>If you choose to buy on the Website, we collect information about your buying behaviour.</p>\r\n\r\n<p>If you transact with us, we collect some additional information, such as a billing address, a credit / debit card number and a credit / debit card expiration date and/ or other payment instrument details and tracking information from cheques or money orders.</p>\r\n\r\n<p>If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback, we will collect that information you provide to us. We retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law.</p>\r\n\r\n<p>If you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Website, we may collect such information into a file specific to you.</p>\r\n\r\n<p><strong>2. Use of Demographic / Profile Data / Your Information</strong></p>\r\n\r\n<p>We use personal information to provide the services you request. To the extent we use your personal information to market to you, we will provide you the ability to opt-out of such uses. We use your personal information to resolve disputes; troubleshoot problems; help promote a safe service; collect money; measure consumer interest in our products and services, inform you about online and offline offers, products, services, and updates; customize your experience; detect and protect us against error, fraud and other criminal activity; enforce our terms and conditions; and as otherwise described to you at the time of collection.</p>\r\n\r\n<p>In our efforts to continually improve our product and service offerings, we collect and analyse demographic and profile data about our users&#39; activity on our Website.</p>\r\n\r\n<p>We identify and use your IP address to help diagnose problems with our server, and to administer our Website. Your IP address is also used to help identify you and to gather broad demographic information.</p>\r\n\r\n<p>We will occasionally ask you to complete optional online surveys. These surveys may ask you for contact information and demographic information (like zip code, age, or income level). We use this data to tailor your experience at our Website, providing you with content that we think you might be interested in and to display content according to your preferences.</p>\r\n\r\n<p>1. Provide you Services as requested by you</p>\r\n\r\n<p>2. help us provide personalized features</p>\r\n\r\n<p>3. to send you information about our new initiatives or other relevant information that we think you might find useful or interesting</p>\r\n\r\n<p>4. to provide you with feedback, newsletters and for other marketing activities.</p>\r\n\r\n<p>5. tailor our sites to your interest</p>\r\n\r\n<p>6. to get in touch with you when necessary<br>\r\n7. to preserve social history as governed by existing law or policy We use information internally to: 1. direct our efforts for service improvement 2. our internal training purpose and data analysis 3. for research, analysis and other business related purposes, subject to not directly disclosing any of your Personal Information</p>\r\n\r\n<p>Generally, we use anonymous traffic information to:</p>\r\n\r\n<p>1. remind us of who you are in order to deliver to you a better and more personalized service;</p>\r\n\r\n<p>2. recognize your access privileges to our Website</p>\r\n\r\n<p>3. track your entries in some of our promotions</p>\r\n\r\n<p>4. help diagnose problems with our server</p>\r\n\r\n<p>5. administer our Website</p>\r\n\r\n<p>6. track your session so that we can understand better how people use our Website</p>\r\n\r\n<p><strong>Cookies</strong></p>\r\n\r\n<p>A \"cookie\" is a small piece of information stored by a web server on a web browser so it can be later read back from that browser. Cookies are useful for enabling the browser to remember information specific to a given user. We place both permanent and temporary cookies in your computer&#39;s hard drive. The cookies do not contain any of your personally identifiable information.</p>\r\n\r\n<p>We use data collection devices such as \"cookies\" on certain pages of the Website to help analyse our web page flow, measure promotional effectiveness, and promote trust and safety. \"Cookies\" are small files placed on your hard drive that assist us in providing our services. We offer certain features that are only available through the use of a \"cookie\". We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are \"session cookies,\" meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use certain features on the Website and you may be required to reÂenter your password more frequently during a session.</p>\r\n\r\n<p>Additionally, you may encounter \"cookies\" or other similar devices on certain pages of the Website that are placed by third parties. We do not control the use of cookies by third parties.</p>\r\n\r\n<p><strong>3. Communication triggered from User&#39;s End:</strong></p>\r\n\r\n<p>We strive to make sure that our user&#39;s experience exceeds the expectations. There are many ways to reach us i.e. via phone, e-mail, chat and other social media channels. Once you initiate a communication from your end, to help improve our Service etiquettes to you, we may catalogue your contact information and correspondence details for later references. This eventually will also enable us to track the responses you provide to us as a feedback for our e-mails and also the number of visits that you as a User make to our Website. This methodology will help us to improve our Services from a customer delight stand point.</p>\r\n\r\n<p><strong>4. Sharing of personal information</strong></p>\r\n\r\n<p>We may share personal information with our other corporate entities and affiliates. These entities and affiliates may market to you as a result of such sharing unless you explicitly opt-out.</p>\r\n\r\n<p>We may disclose personal information to third parties. This disclosure may be required for us to provide you access to our Services, to comply with our legal obligations, to enforce our User Agreement, to facilitate our marketing and advertising activities, or to prevent, detect, mitigate,and investigate fraudulent or illegal activities related to our Services. We do not disclose your personal information to third parties for their marketing and advertising purposes without your explicit consent. Such third parties do not have any right to use the Personal Information we share with them beyond what is necessary to assist us to provide the Services and we take reasonable steps to ensure that these third parties are obligated to protect the Personal Information in the same manner as contemplated herein.</p>\r\n\r\n<p>We may disclose personal information if required to do so by law or in the good faith belief that such disclosure is reasonably necessary to respond to subpoenas, court orders, or other legal process. We may disclose personal information to law enforcement offices, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to: enforce our Terms or Privacy Policy; respond to claims that an advertisement, posting or other content violates the rights of a third party; or protect the rights, property or personal safety of our users or the general public.</p>\r\n\r\n<p>We may, however, disclose your Personal Information under the following circumstances:</p>\r\n\r\n<p>1. To respond to court orders, or legal process, or to establish or exercise our legal rights or defend against legal claims; or</p>\r\n\r\n<p>2. If we believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of our terms of use, or as otherwise required by law.</p>\r\n\r\n<p>In due course of time we might use your Personal Information for any new and unanticipated reason not expressly mentioned in this Policy. We will obtain your consent in such cases as may be required by law.</p>\r\n\r\n<p>We and our affiliates will share / sell some or all of your personal information with another business entity should we (or our assets) plan to merge with, or be acquired by that business entity, or reÂorganization, amalgamation, restructuring of business. Should such a transaction occur that other business entity (or the new combined entity) will be required to follow this privacy policy with respect to your personal information.</p>\r\n\r\n<p xss=\"removed\">Disclosure policy in compliance with rule 6 of the IT Rules 2011</p>\r\n\r\n<p>The Personal Information may be disclosed to any person, if such disclosure is required for a lawful purpose connected with a function or activity of Website.</p>\r\n\r\n<p>The Personal Information may be disclosed, where the disclosure is necessary for compliance of a legal obligation.</p>\r\n\r\n<p>We do not rent, sell, publish or share your Personal Information and we will not disclose any of your personally identifiable information unless:</p>\r\n\r\n<p>1. we have your permission.</p>\r\n\r\n<p>2. to help investigate, prevent or take action regarding unlawful and illegal activities, suspected fraud, including cyber incidents potential threat, punishment of offences and to the safety or security of any person, violations of Prasadmedical appâ€˜s terms of use or to defend against legal claims;</p>\r\n\r\n<p>3. Special circumstances such as compliance with subpoenas, court orders, requests/order from legal authorities or law enforcement agencies requiring such disclosure.</p>\r\n\r\n<p><strong>4. What security procedures are in place to protect information from loss, misuse or alteration?</strong></p>\r\n\r\n<p>To protect against the loss, misuse and alteration of the information under our control, and to comply with Rule 8 of IT Rules, 2011 (Reasonable security practices and procedures and sensitive personal data or information), we have in place appropriate physical, electronic, technical, operational and managerial procedures.</p>\r\n\r\n<p>Our Website has stringent security measures in place to protect the loss, misuse, and alteration of the information under our control. Whenever you change or access your account information, we offer the use of a secure server. Once your information is in our possession we adhere to strict security guidelines, protecting it against unauthorized access.</p>\r\n\r\n<p>Our servers are accessible only to authorized personnel and your information is shared with respective personnel to complete the transaction and to provide the Services requested by you.</p>\r\n\r\n<p>Although we will endeavor to safeguard the confidentiality of your sensitive personal identifiable information, transmissions made by means of the Internet cannot be made absolutely secure. No such measures are competent enough to safeguard your Personal Information in a complete 100% way. Hence, you are also encouraged to take steps to prevent your Personal Information from being misused by logging off after using a shared computer, choosing a robust password , not sharing the password with anyone and changing it periodically. We in no way can are to be held responsible for the unauthorized use of your Personal Information or for any suspicious activity on your account. By using our Website, you agree that we will have no liability for disclosure of your information due to errors in transmission or unauthorized acts of third parties.</p>\r\n\r\n<p><strong>6. Links to Other Sites</strong></p>\r\n\r\n<p>Our Website links to other websites that may collect personally identifiable information about you. Prasadmedical.com is not responsible for the privacy practices or the content of those linked websites.</p>\r\n\r\n<p><strong>7. Choice/Opt-Out </strong></p>\r\n\r\n<p>We provide all users with the opportunity to opt-out of receiving non-essential (promotional, marketing-related) communications from us on behalf of our partners, and from us in general, after setting up an account.</p>\r\n\r\n<p>If you want to remove your contact information from all prasadmedical appindia.com lists and newsletters, please visit unsubscribe.</p>\r\n\r\n<p><strong>8. Advertisements on Prasadmedical.com </strong></p>\r\n\r\n<p>We use third-party advertising companies to serve ads when you visit our Website. These companies may use information (not including your name, address, email address, or telephone number) about your visits to this and other websites in order to provide advertisements about goods and services of interest to you.</p>\r\n\r\n<p><strong>9. Your Consent</strong></p>\r\n\r\n<p>By using the Website and/ or by providing your information, you consent to the collection and use of the information you disclose on the Website in accordance with this Privacy Policy, including but not limited to your consent for sharing your information as per this privacy policy.</p>\r\n\r\n<p>If we decide to change our privacy policy, we reserve the right but not obligated to post those changes on this page so that you are always aware of what information we collect, how we use it, and under what circumstances we disclose it. However, as advised above, please go through our Privacy Policy at regular intervals.</p>\r\n\r\n<p><strong>10. User declarations:</strong></p>\r\n\r\n<p>1. I understand and have the knowledge that Personal Information is being collected.</p>\r\n\r\n<p>2. I understand and have the knowledge of the purpose for which my Personal Information is being collected.</p>\r\n\r\n<p>3. I understand and have the knowledge of the indented recipients of the information.</p>\r\n\r\n<p>4. I understand that I have the option not to provide the data or information sought to be collected by Prasadmedical app and the Website.</p>\r\n\r\n<p>5. I understand that I also have an option (while availing the services of Prasadmedical app, Website or otherwise) to withdraw my consent given earlier to Prasadmedical app and understand and accept that such withdrawal of the consent shall be sent in writing and in such case Prasadmedical app shall have the option not to provide the services for which the said information was sought at its discretion.</p>\r\n\r\n<p>6. I read and have understood this Privacy Policy and all other policies governing the usage of the Website.</p>\r\n\r\n<p><strong>11. Grievance Officer</strong></p>\r\n\r\n<p>In accordance with Information Technology Act 2000 and rules made there under, the name and contact details of the Grievance Officer are provided below:</p>\r\n\r\n<p><strong>Prasad Chandrakant Phasate</strong></p>\r\n\r\n<p>c/o Prasad medical and general stores</p>\r\n\r\n<p>opposite bank of India,</p>\r\n\r\n<p>cement road, pratapnagar, Nagpur, Maharashtra, India 440022</p>\r\n\r\n<p>time -0800 to 2300 hrs.</p>\r\n\r\n<p><strong>12. Questions?</strong></p>\r\n\r\n<p>Please contact us regarding any questions regarding this statement.</p>', 'Active', '2019-05-28 11:43:52', '2019-05-28 11:43:52');
