r\n    padding-right:2em;\r\n    padding-bottom:2em;\r\n    padding-left:2em;\r\n    text-align:left\r\n    }\r\n\r\n    /**\r\n    * @tab Footer\r\n    * @section footer link\r\n    * @tip Set the styling for your email\'s footer links. Choose a color that helps them stand out from your text.\r\n    */\r\n    .footerContent a:link,.footerContent a:visited,/* Yahoo! Mail Override */ .footerContent a .yshortcuts,.footerContent a span /* Yahoo! Mail Override */ {\r\n    color:#606060;\r\n    font-weight:400;\r\n    text-decoration:underline\r\n    }\r\n\r\n    /**\r\n    * @tab Footer\r\n    * @section footer link\r\n    * @tip Set the styling for your email\'s footer links. Choose a color that helps them stand out from your text.\r\n    */\r\n    .bodyContentImageFull p {\r\n    font-size:0!important;\r\n    margin-bottom:0!important\r\n    }\r\n\r\n    .brdBottomPadd {\r\n    border-bottom:1px solid #f0f0f0\r\n    }\r\n\r\n    .brdBottomPadd-two {\r\n    border-bottom:1px solid #f0f0f0\r\n    }\r\n\r\n    .brdBottomPadd .bodyContent {\r\n    padding-bottom:2.286em\r\n    }\r\n\r\n    .brdBottomPadd-two .bodyContent {\r\n    padding-bottom:.857em\r\n    }\r\n\r\n    a.blue-btn {\r\n      background: #5098ea;\r\n      display: inline-block;\r\n      color: #FFFFFF;\r\n      border-top:10px solid #5098ea;\r\n      border-bottom:10px solid #5098ea;\r\n      border-left:20px solid #5098ea;\r\n      border-right:20px solid #5098ea;\r\n      text-decoration: none;\r\n      font-size: 14px;\r\n      margin-top: 1.0em;\r\n      border-radius: 3px 3px 3px 3px;\r\n      background-clip: padding-box;\r\n    }\r\n\r\n    .bodyContentTicks {\r\n    color:#505050;\r\n    font-family:Helvetica;\r\n    font-size:14px;\r\n    line-height:150%;\r\n    padding-top:2.857em;\r\n    padding-right:3.5em;\r\n    padding-left:3.5em;\r\n    padding-bottom:1.786em;\r\n    text-align:left\r\n    }\r\n\r\n    .splitTicks {\r\n    width:100%\r\n    }\r\n\r\n    .splitTicks--one {\r\n    width:19%