(8, 'New Order', '{company_name}: New Order {order_no}', '<meta content=\"text/html; charset=UTF-8\" http-equiv=\"Content-Type\" />\r\n<title></title>\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\" />\r\n<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" style=\"background-color: #FFFFFF\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><!--[if (gte mso 9)|(IE)]>\r\n      <table width=\"600\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n        <tr>\r\n          <td>\r\n    <![endif]-->\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"content\" style=\"background-color: #FFFFFF\">\r\n				<tbody>\r\n					<tr>\r\n						<td id=\"templateContainerHeader\" mc:edit=\"welcomeEdit-01\" valign=\"top\">\r\n						<p style=\"text-align:center;margin:0;padding:0;\">{logo}</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two\" id=\"templateContainer\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-02\" valign=\"top\">\r\n									<p>Dear&nbsp; {user_name},</p>\r\n\r\n									<h1>Thank you for your order from {company_name}.</h1>\r\n\r\n									<p>Once your package ships we will send an email with a link to track your order. Your order summary is below. Thank you again for your business.</p>\r\n\r\n									<h4>Order Questions?</h4>\r\n\r\n									<p><b>Call Us:</b> <a href=\"{company_no}\">{company_no}</a><br />\r\n									<b>Email:</b> <a href=\"mailto:{email}\">{email}</a></p>\r\n\r\n									<h3>Your order <span class=\"no-link\">{order_no}</span></h3>\r\n\r\n									<p>Placed on {order_date}</p>\r\n\r\n									<h4>Payment method: {payment_mode}</h4>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td style=\"padding:10px; font-family: Arial, Helvetica, sans-serif; font