\n      border-top:10px solid #5098ea;\r\n      border-bottom:10px solid #5098ea;\r\n      border-left:20px solid #5098ea;\r\n      border-right:20px solid #5098ea;\r\n      text-decoration: none;\r\n      font-size: 14px;\r\n      margin-top: 1.0em;\r\n      border-radius: 3px 3px 3px 3px;\r\n      background-clip: padding-box;\r\n    }\r\n\r\n    .bodyContentTicks {\r\n    color:#505050;\r\n    font-family:Helvetica;\r\n    font-size:14px;\r\n    line-height:150%;\r\n    padding-top:2.857em;\r\n    padding-right:3.5em;\r\n    padding-left:3.5em;\r\n    padding-bottom:1.786em;\r\n    text-align:left\r\n    }\r\n\r\n    .splitTicks {\r\n    width:100%\r\n    }\r\n\r\n    .splitTicks--one {\r\n    width:19%;\r\n    color:#505050;\r\n    font-family:Helvetica;\r\n    font-size:14px;\r\n    padding-bottom:1.143em\r\n    }\r\n\r\n    .splitTicks--two {\r\n    width:5%\r\n    }\r\n\r\n    .splitTicks--three {\r\n    width:71%;\r\n    color:#505050;\r\n    font-family:Helvetica;\r\n    font-size:14px;\r\n    padding-top:.714em\r\n    }\r\n\r\n    .splitTicks--three h3 {\r\n    margin-bottom:.278em\r\n    }\r\n\r\n    .splitTicks--four {\r\n    width:5%\r\n    }\r\n\r\n    @media only screen and (max-width: 550px),screen and (max-device-width: 550px) {\r\n    body[yahoo] .hide {\r\n    display:none!important\r\n    }\r\n\r\n    body[yahoo] .buttonwrapper {\r\n    background-color:transparent!important\r\n    }\r\n\r\n    body[yahoo] .button {\r\n    padding:0!important\r\n    }\r\n\r\n    body[yahoo] .button a {\r\n    background-color:#e05443;\r\n    padding:15px 15px 13px!important\r\n    }\r\n\r\n    body[yahoo] .unsubscribe {\r\n    font-size:14px;\r\n    display:block;\r\n    margin-top:.714em;\r\n    padding:10px 50px;\r\n    background:#2f3942;\r\n    border-radius:5px;\r\n    text-decoration:none!important\r\n    }\r\n    }\r\n\r\n    @media only screen and (max-width: 480px),screen and (max-device-width: 480px) {\r\n      .bodyContentTicks {\r\n        padding:6% 5% 5% 6%!important\r\n      }\r\n\r\n      .bodyContentTicks td {\r\n        padding-top:0!important\r\n      }\r\n\r\n      h1 {\r\n        font-size:34px!important\r\n      }\r\n\r\n      h2 {\r\n        font-size:20px!important\r\n      }\r\n\r\n      h3 {\r\n        font-size:16px!important\r\n      }\r\n\r\n      h4 {\r\n        font-size:15px!important\r\n      }\r\n\r\n      h5 {\r\n        font-size:16px!important\r\n      }\r\n\r\n      h6 {\r\n        font-size:14px!important\r\n      }\r\n\r\n      p {\r\n        font-size:14px!important\r\n      }\r\n\r\n      .brdBottomPadd .bodyContent {\r\n        padding-bottom:2.286em!important\r\n      }\r\n\r\n      .brdBottomPadd-two .bodyContent {\r\n        padding-bottom:.857em!important\r\n      }\r\n\r\n      #templateContainerMiddleBtm .bodyContent {\r\n        padding:6% 5% 5% 6%!important\r\n      }\r\n\r\n      .bodyContent {\r\n        padding:6% 5% 1% 6%!important\r\n      }\r\n\r\n      .bodyContent img {\r\n        max-width:100%!important\r\n      }\r\n\r\n      .bodyContentImage {\r\n        padding:3% 6% 6%!important\r\n      }\r\n\r\n      .bodyContentImage img {\r\n        max-width:100%!important\r\n      }\r\n\r\n      .bodyContentImage h4 {\r\n        font-size:12px!important\r\n      }\r\n\r\n      .bodyContentImage h5 {\r\n        font-size:15px!important;\r\n        margin-top:0\r\n      }\r\n    }\r\n    .ii a[href] {color: inherit !important;}\r\n    span > a, span > a[href] {color: inherit !important;}\r\n    a > span, .ii a[href] > span {text-decoration: inherit !important;}\r\n</style>\r\n', '2019-06-12 01:21:38', '2019-06-12 01:21:38', 0);
INSERT INTO `mst_mail_body` (`id`, `type`, `mail_subject`, `mail_body`, `created`, `modified`, `modified_by`) VALUES
(9, 'Prescription Order', '{company_name}', '<meta content=\"text/html; charset=UTF-8\" http-equiv=\"Content-Type\" />\r\n<title></title>\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\" />\r\n<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" style=\"background-color: #FFFFFF\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><!--[if (gte mso 9)|(IE)]>\r\n      <table width=\"600\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n        <tr>\r\n          <td>\r\n    <![endif]-->\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"content\" style=\"background-color: #FFFFFF\">\r\n				<tbody>\r\n					<tr>\r\n						<td id=\"templateContainerHeader\" mc:edit=\"welcomeEdit-01\" valign=\"top\">\r\n						<p style=\"text-align:center;margin:0;padding:0;\">{logo}</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"brdBottomPadd-two\" id=\"templateContainer\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-02\" valign=\"top\">\r\n									<p>Dear&nbsp; <strong>{user_name}</strong>,</p>\r\n\r\n									<h5>As per your prescription the amount and details are sent to your account please click on below link for further details.</h5>\r\n\r\n									<p>{link}</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" valign=\"top\"><!-- BEGIN BODY // -->\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerMiddleBtm\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"bodyContent\" mc:edit=\"welcomeEdit-11\" valign=\"top\">\r\n									<p>If you are having difficulties in your purchase order, then please feel free to contact us by phone at {company_no}(11 am to 7 pm).<br />\r\n									&nbsp;</p>\r\n\r\n									<p><strong>Kind Regards,<br />\r\n									{company_name}</strong></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						<!-- // END BODY --></td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" class=\"unSubContent\" id=\"bodyCellFooter\" valign=\"top\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainerFooter\" width=\"100%\">\r\n							<tbody>\r\n								<tr>\r\n									<td mc:edit=\"welcomeEdit-11\" valign=\"top\" width=\"100%\">\r\n									<h6 style=\"text-align:center;margin-top: 9px;\">This is a computer auto generated message. Please do not reply.</h6>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			<!--[if (gte mso 9)|(IE)]>\r\n          </td>\r\n        </tr>\r\n    </table>\r\n    <![endif]--></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<style type=\"text/css\">span.preheader {\r\n    display:none!important\r\n    }\r\n    td ul li {\r\n      font-size: 16px;\r\n    }\r\n\r\n    /* /\\/\\/\\/\\/\\/\\/\\/\\/ CLIENT-SPECIFIC STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\r\n    #outlook a {\r\n    padding:0\r\n    }\r\n\r\n    /* Force Outlook to provide a \"view in browser\" message */\r\n    .ReadMsgBody {\r\n    width:100%\r\n    }\r\n\r\n    .ExternalClass {\r\n    width:100%\r\n    }\r\n\r\n    /* Force Hotmail to display emails at full width */\r\n    .ExternalClass,.ExternalClass p,.ExternalClass span,.ExternalClass font,.ExternalClass td,.ExternalClass div {\r\n    line-height:100%\r\n    }\r\n\r\n    /* Force Hotmail to display normal line spacing */\r\n    body,table,td,p,a,li,blockquote {\r\n    -webkit-text-size-adjust:100%;\r\n    -ms-text-size-adjust:100%\r\n    }\r\n\r\n    /* Prevent WebKit and Windows mobile changing default text sizes */\r\n    table,td {\r\n    mso-table-lspace:0;\r\n    mso-table-rspace:0\r\n    }\r\n\r\n    /* Remove spacing between tables in Outlook 2007 and up */\r\n    /* /\\/\\/\\/\\/\\/\\/\\/\\/ RESET STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\r\n    body {\r\n    margin:0;\r\n    padding:0\r\n    }\r\n\r\n    img {\r\n    max-width:100%;\r\n    border:0;\r\n    line-height:100%;\r\n    outline:none;\r\n    text-decoration:none\r\n    }\r\n\r\n    table {\r\n    border-collapse:collapse!important\r\n    }\r\n\r\n    .content {\r\n    width:100%;\r\n    max-width:600px\r\n    }\r\n\r\n    .content img {\r\n    height:auto;\r\n    min-height:1px\r\n    }\r\n\r\n    #bodyTable {\r\n    margin:0;\r\n    padding:0;\r\n    width:100%!important\r\n    }\r\n\r\n    #bodyCell {\r\n    margin:0;\r\n    padding:0\r\n    }\r\n\r\n    #bodyCellFooter {\r\n    margin:0;\r\n    padding:0;\r\n    width:100%!important;\r\n    padding-top:10px;\r\n    padding-bottom:15px\r\n    }\r\n\r\n    body {\r\n    margin:0;\r\n    padding:0;\r\n    min-width:100%!important\r\n    }\r\n\r\n    #templateContainerHeader {\r\n    font-size:14px;\r\n    padding-top:2.429em;\r\n    padding-bottom:.929em\r\n    }\r\n\r\n    #templateContainerFootBrd {\r\n    border-bottom:1px solid #e2e2e2;\r\n    border-left:1px solid #e2e2e2;\r\n    border-right:1px solid #e2e2e2;\r\n    border-radius:0 0 4px 4px;\r\n    background-clip:padding-box;\r\n    border-spacing:0;\r\n    height:10px;\r\n    width:100%!important\r\n    }\r\n\r\n    #templateContainer {\r\n    border-top:1px solid #e2e2e2;\r\n    border-left:1px solid #e2e2e2;\r\n    border-right:1px solid #e2e2e2;\r\n    border-radius:4px 4px 0 0;\r\n    background-clip:padding-box;\r\n    border-spacing:0\r\n    }\r\n\r\n    #templateContainerMiddle {\r\n    border-left:1px solid #e2e2e2;\r\n    border-right:1px solid #e2e2e2\r\n    }\r\n\r\n    #templateContainerMiddleBtm {\r\n    border-left:1px solid #e2e2e2;\r\n    border-right:1px solid #e2e2e2;\r\n    border-bottom:1px solid #e2e2e2;\r\n    border-radius:0 0 4px 4px;\r\n    background-clip:padding-box;\r\n    border-spacing: