INSERT INTO `settings` (`id`, `site_name`, `email`, `mobile`, `copyright`, `address`, `logo`, `logo_title`, `favicon`, `extra_pincode_charges`, `terms_and_condition`, `prescription_guide`, `created`, `modified`) VALUES
(1, 'Medicines And More...', 'helpmedicinesandmore@gmail.com', 8149555590, 'Copyright @Medicines And More...', 'Medicines And More...\r\n\'VastuPratik\' Appartment,\r\nopposite bank of India,, pratapnagar, Nagpur,\r\nMaharashtra, India 440022', '5828_logo - 80x80.png', 'Medicines And More', '6418_logo - 80x80.png', 40, '<p>Medicine Delivery Policy</p>\r\n\r\n<p>Important Instructions:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Valid prescription from a Doctor is mandatory for all medicine orders&nbsp;<br />\r\n2. Kindly display the original prescription at the time of picking up medicines&nbsp;<br />\r\n3. We will not be able to process the orders without a valid prescription&nbsp;<br />\r\n4. Please show prescription at the time of delivery</p>\r\n\r\n<p>5. HOME DELIVERYS NOT AVAILABLE FOR SCHADULED DRUGS.</p>\r\n\r\n<p>6. Delivery charges depend on mode of transit and will be communicated before dispatch.</p>\r\n\r\n<p>7. Delivery charges within Nagpur city is Rs.6 per kilometer.&nbsp;</p>\r\n\r\n<p>Note:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. You are required to send a scan copy or photo of valid prescription from an authorized Doctor which is mandatory&nbsp;<br />\r\n2. No medicine will be delivered if the order amount is below Rs.1000 and avail free home delivery&nbsp;<br />\r\n3. Payment method only COD (Cash on Delivery) or card payment on doorstep is available&nbsp;<br />\r\n4. For all in stock items the delivery time will be confirmed by telephonic communication or notification through app or by SMS subject to availability.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Upload Prescription:*</p>\r\n\r\n<p>Allowed file types: doc, docx, jpeg &amp; pdf.<br />\r\nMandatory contents required in prescription<br />\r\n- Doctor&#39;s Registration Number<br />\r\n- Doctor&#39;s Name and Address<br />\r\n- Patients Name and Age<br />\r\n- Prescription Date (According to Prescription and doses)<br />\r\n- Rx Symbol<br />\r\n- Medicine Name<br />\r\n<br />\r\n<br />\r\nPlease enter the list of drugs to avoid misreading, However it is not mandatory.</p>\r\n\r\n<div>\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p>Once the order is placed by either method,&nbsp;Prasad medical &amp; general stores shall examine the authenticity of the order in terms of Products ordered &amp; will&nbsp;deliver the order after complying with the requirements of Drugs and Cosmetic Act. Please note that for some medicines which are sensitive to pharmacy rules, we will ask a genuine prescription to be verified before sale.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>E-mail And SMS</strong></p>\r\n\r\n<p>By registering Your phone number and email with us, You consent to be contacted by Us via phone calls and/or SMS notifications or emails, in case of any order or shipment or delivery related updates and/or to update you about new offers and promotions..</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Refunds Possible If</strong><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"margin-left:23.4pt;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; you received a defective item;</p>\r\n\r\n<p style=\"margin-left:23.4pt;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the ordered item(s) is lost or damaged during transit;</p>\r\n\r\n<p style=\"margin-left:23.4pt;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the ordered item(s) is past its expiry date.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to these Terms and Conditions</strong><br />\r\n<br />\r\nwe reserve the right to amend these terms and conditions from time to time without further notice to you. Any such amendments we make shall be effective once we post a revised version of these Terms and Conditions</p>\r\n', '<ol>\r\n	<li>Don&rsquo;t crop out any part of the image</li>\r\n	<li>Avoid blurred image</li>\r\n	<li>Include details of doctor and patient + clinic visit date</li>\r\n	<li>Medicines will be dispensed as per prescription</li>\r\n	<li>Supported files type: jpeg , jpg , png</li>\r\n	<li>Maximum allowed file size: 5MB</li>\r\n</ol>\r\n', '2019-10-15 21:54:23', '2019-10-15 21:54:23');
